    "contracts/access/TailorControlAccess.sol": {
      "content": "//SPDX-License-Identifier: Unlicense
pragma solidity 0.8.9;
/**
 * Contract that manages the control access to underlying smart contracts.
 */
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";

contract TailorControlAccess is
    Initializable,
    AccessControlUpgradeable,
    OwnableUpgradeable
{
    bytes32 internal constant TAILOR_ADMIN = keccak256("TAILOR_ADMIN"); // 0x3f6ce2d5571ab8f3fb1cf068a92ec99edc01aa4a757338b1f082acee66c84cb2
    bytes32 internal constant COLLECTION_CREATOR =
        keccak256("COLLECTION_CREATOR"); // 0x605f3e359b5224b78fd55afc82a0086dba41cff5d3cb8e860e84b9e27d7c4dfa
    bytes32 internal constant TRUSTED_FORWARDER =
        keccak256("TRUSTED_FORWARDER"); // 0xba1aa5bbc6b8041418eeb66d935650729704cb07d45789621b0f966fb6decb10
